import { useEffect } from "react"
import { useNavigate } from "react-router-dom"

function NotFound() {

  document.title = "404";

  const navigate = useNavigate()

  useEffect(() => {
    setTimeout(() => {
      navigate("/")
    }, 3000)
  },[])

  return (
    <div>
      <h1>Page Not Found</h1>
    </div>
  )
}

export default NotFound
